// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.7;

contract TaskContract {

    uint nextId;

    struct Task{
        uint id;
        string name;
        string description;

    } 

    Task[] tasks;



    function createTask() public{
        tasks.push(Task(nextId,'Limpiar','Con la escoba.'));
        nextId++;
    }

    function readTask(uint _id) public {
        uint index = findIndex(_id);


    }   

    function findIndex(uint _id) internal returns (uint){

        for(uint i=0; i < tasks.length;i++){
            if(tasks[i].id == _id){
                return i;
            }
        }
        revert('Task not Found');
    }


}

